import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });

    // Click the first "Your Profile" link (simulate navigation to profile)
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length === 0) throw new Error('No "Your Profile" link found');
    await profileLinks[0].click();

    // Wait for the profile image to appear (using alt attribute)
    await page.waitForSelector('img[alt="Jun Kim"]', { timeout: 5000 });

    // Take screenshot of profile section
    const step2 = path.join(screenshotsDir, 'step_2_profile_section.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract Jun's profile information using different selector strategies
    // Full Name (from .profile-info h2)
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());

    // Username (from .username)
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    // Bio (from .bio)
    const bio = await page.$eval('.profile-info .bio', el => el.textContent.trim());

    // Stats (Orders, Reviews, Seller Rating) using .stat-number
    const statNumbers = await page.$$eval('.profile-stats .stat-number', els => els.map(e => e.textContent.trim()));
    const [totalOrders, totalReviews, sellerRating] = statNumbers;

    // Email (from script tag data, fallback: not visible on page)
    // Join Date (from script tag data, fallback: not visible on page)

    // Profile Image src
    const profileImage = await page.$eval('img[alt="Jun Kim"]', el => el.getAttribute('src'));

    // Take screenshot of stats
    const step3 = path.join(screenshotsDir, 'step_3_profile_stats.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract Jun's products (using section heading and next .products-grid)
    // Use XPath to find the "Products by Jun" section and get product titles
    const junProductsSection = await page.$('//h3[contains(text(), "Products by Jun")]/following-sibling::div[contains(@class, "products-grid")]');
    let junProductTitles = [];
    if (junProductsSection) {
      junProductTitles = await junProductsSection.$$eval('.product-title', els => els.map(e => e.textContent.trim()));
    }

    // Extract Jun's reviews (using section heading and next .reviews-list)
    const junReviewsSection = await page.$('//h3[contains(text(), "Jun\'s Recent Reviews")]/following-sibling::div[contains(@class, "reviews-list")]');
    let junReviewTitles = [];
    if (junReviewsSection) {
      junReviewTitles = await junReviewsSection.$$eval('.review-title', els => els.map(e => e.textContent.replace(/"/g, '').trim()));
    }

    // Take screenshot of Jun's products
    const step4 = path.join(screenshotsDir, 'step_4_jun_products.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Take screenshot of Jun's reviews
    const step5 = path.join(screenshotsDir, 'step_5_jun_reviews.png');
    await page.screenshot({ path: step5 });
    screenshots.push(step5);

    // Compose extracted data
    const extractedData = {
      fullName,
      username,
      bio,
      totalOrders,
      totalReviews,
      sellerRating,
      profileImage,
      junProductTitles,
      junReviewTitles
    };

    return {
      success: true,
      action: "Harvested Jun's user profile information, products, and reviews from the profile page",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
